import { Component } from '@angular/core';

@Component({
  selector: 'app-about',
  templateUrl: './about.component.html',
  styleUrls: ['./about.component.css']
})
export class AboutComponent {
  title: string = 'Sobre a aplicação';
}
<div class="about">
  <h2>{{ title }}</h2>
  <p>Esta aplicação foi desenvolvida por <span class="bold">Felipe Silva</span> utilizando o framework <span class="bold">Angular 2</span>, que utiliza como linguagem de programação o <span class="bold">TypeScript</span></p>
</div>
